import React from "react";
import { BrowserRouter } from "react-router-dom";
import Navbar from "./Components/Layout/Navbar";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <div>INVENTORY</div>
    </BrowserRouter>
  );
}

export default App;
